    public static void addMicroScore(
        MapLocation myLoc, MapLocation targetLoc, char targetDir, long attackScore, long attackBonusRatnap
    ){
        switch(targetDir){
            case 0:
                addMicroScoreNORTH(myLoc, targetLoc, attackScore, attackBonusRatnap);
                break;
            case 1:
                addMicroScoreNORTHEAST(myLoc, targetLoc, attackScore, attackBonusRatnap);
                break;
            case 2:
                addMicroScoreEAST(myLoc, targetLoc, attackScore, attackBonusRatnap);
                break;
            case 3:
                addMicroScoreSOUTHEAST(myLoc, targetLoc, attackScore, attackBonusRatnap);
                break;
            case 4:
                addMicroScoreSOUTH(myLoc, targetLoc, attackScore, attackBonusRatnap);
                break;
            case 5:
                addMicroScoreSOUTHWEST(myLoc, targetLoc, attackScore, attackBonusRatnap);
                break;
            case 6:
                addMicroScoreWEST(myLoc, targetLoc, attackScore, attackBonusRatnap);
                break;
            case 7:
                addMicroScoreNORTHWEST(myLoc, targetLoc, attackScore, attackBonusRatnap);
                break;
            default:
                System.out.println("Err: target dir unsupported " + targetDir);
                return;
        };
    }

